import { StyleSheet } from 'react-native';
export const headerStyle = StyleSheet.create({
    header:{
        marginVertical:12,
    },
    headerText:{
        fontFamily: 'RobotoCondensed_700Bold_Italic',
        fontSize: 22,
        letterSpacing:1
    } 
});
export const headerBackground = {
    image : require('../assets/headerBackground.png')
}
